import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [formError, setFormError] = useState('');

  const handleLogin = () => {
    if (!username || !password) {
      setFormError('Please fill in both the Username and Password fields.');
    } else {
      alert('Logged in successfully!');
    }
  };

  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/help">Contact Us</Link>
        <Link to="/service">Services</Link>
        <Link to="/login">Login</Link>
      </nav>
      <div className="container">
        <div className="content">
          <div className="text">
            <center>
              <h2>LOGIN</h2>
            </center>
            <div className="login-box">
              <div className="box-heading">Username:</div>
              <input
                type="text"
                className="box-input"
                placeholder="Enter your username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
              <div className="box-heading">Password:</div>
              <input
                type="password"
                className="box-input"
                placeholder="Enter your password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
              {formError && <div className="error-message">{formError}</div>}
              <Link to="/ForgotPassword">Forgot Password?</Link>
              <div className="box-button">
                <button onClick={handleLogin}>LOGIN</button>
              </div>
            </div>
          </div>
          <center>
            <div className="text">
              <h2>If you don't have an account, register here</h2>
              <Link to="/SignUp">
                <button className="box-button">REGISTER</button>
              </Link>
            </div>
          </center>
        </div>
        <br />
        <br />
        <center>
          <div>
            <Link to="/studentdashboard">Student</Link>&nbsp;
            <Link to="/programcoordinatordashboard">Program Coordinator</Link>&nbsp;
            <Link to="/instructordashboard">Instructor</Link>&nbsp;
            <Link to="/qaofficerdashboard">QA Officer</Link>&nbsp;
            <Link to="/administratordashboard">Administrator</Link>
          </div>
        </center>
      </div>
      <footer>
        <p>&copy; Copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
}

export default Login;
